const defaultStaticAssetUrlBuilder = require('../../lib/default-asset-url-builder');

describe('defaultStaticAssetUrlBuilder', () => {
  test('should compose the complete URL of JS resource', () => {
    expect(defaultStaticAssetUrlBuilder('https://http2.mlstatic.com/resources/frontend/', 'vendor.js'))
      .toEqual('https://http2.mlstatic.com/resources/frontend/vendor.js');
  });
});
